/**
 * A dictionary containing ephemerides of planets and other well-known objects.
 * @example
 * const planet1 = viz.createObject('planet1', {
 *   ephem: EphemPresets.MERCURY,
 * });
 */
export declare const EphemPresets: {
    MERCURY: any;
    VENUS: any;
    EARTH: any;
    MOON: any;
    MARS: any;
    JUPITER: any;
    SATURN: any;
    URANUS: any;
    NEPTUNE: any;
    PLUTO: any;
};
